# pip install google-genai

import base64
import os
from google import genai
from google.genai import types

# 예제, 이런식으로 레쥬메랑 올리기
def generate():
    client = genai.Client(
        api_key=os.environ.get("GEMINI_API_KEY"),
    )

    model = "gemini-2.5-pro"
    contents = [
        types.Content(
            role="user",
            parts=[
                types.Part.from_bytes(
                    mime_type="application/pdf",
                    data=base64.b64decode(
                        """"""
                    ),
                ),
                types.Part.from_bytes(
                    mime_type="application/pdf",
                    data=base64.b64decode(
                        """"""
                    ),
                ),
            ],
        ),
        types.Content(
            role="model",
            parts=[
                types.Part.from_text(text="""**Analyzing Resume-Transcript Data**

I've been tasked with acting as a resume and transcript reviewer. My current focus involves setting the parameters for a thorough comparison. The goal is to flag any discrepancies between the resume and academic record. Next, I will begin the process of examining the two sources of information.


**Reviewing Data Components**

I'm now in the process of mapping out the specific data points I'll be comparing. I've broken down the resume and transcript into key sections: personal details, education, and any listed projects or awards. My plan is to thoroughly examine each component to ensure consistency and quickly flag any potential red flags, like mismatched degrees or enrollment dates. The system I have built will compare names and universities and match them.


**Defining Critical Comparison Points**

I'm now identifying the most critical areas for comparison, based on the resumes and transcripts I've analyzed. I'm focusing on discrepancies in dates, especially enrollment and graduation. I will also pay close attention to the course names mentioned in projects to ensure they align with the transcript. I am building a system to extract and verify the data points.


**Developing Comparison Logic**

I'm now building the comparison logic, using the detailed plan. My focus is on the crucial date comparisons, especially those regarding enrollment and graduation, to flag any inconsistencies. I will refine the matching criteria for personal details and academic achievements, to minimize potential false positives. I will refine the code to flag date mismatches, then check the transcript for contextual explanations like prior learning.


**Evaluating Date Alignment**

I've been meticulously analyzing the student's dates: enrollment, leaves of absence, and conferral. The resume's \"Feb 2019\" start date now prompts closer inspection, especially given the transcript's initial 2020 entry. The resume's November 2024 end date aligns with the transcript's 2025 graduation. The leaves seem to explain date discrepancies, though.


**Examining Date Anomalies**

I'm now zeroing in on the \"2019\" start date listed on the resume, which conflicts with the transcript's 2020 commencement. The key here are the documented leaves of absence, which span a significant portion of the student's academic journey. I'm carefully analyzing how these leaves might impact the start date. Further, the degree conferral date in early 2025, from the transcript, aligns well with the \"Nov 2024\" graduation listed on the resume, which is encouraging. The transcript's general credit and exemption information may provide further explanations.


**Evaluating Overall Alignment**

I've finished comparing the resume and transcript, and I've identified key discrepancies. The most significant issue is the incorrect year listed for the Dean's List achievement. I also noted an important omission on the resume: the \"with Distinction\" award. The date discrepancies, while present, seem explainable given the leaves of absence and enrollment details. I am now finalizing my review.


**Evaluating Key Findings**

I've completed my analysis of the data. I've uncovered a notable discrepancy regarding the Dean's List year and an important omission of a \"with Distinction\" award. While start and end dates differ, their alignment, coupled with the leaves of absence, suggests these inconsistencies are minor. My review is finalized.


"""),
                types.Part.from_text(text="""Based on a detailed comparison between the resume and the academic transcript, here is a review of the information provided.

Overall, the information on the resume is largely consistent with the academic transcript, particularly regarding the degree, major, GPA/WAM, and project coursework. However, there are a couple of notable discrepancies.

### **Education & Awards**

*   **GPA and WAM:** The GPA (6.38) and WAM (84.12) listed on the resume are a **perfect match** with the values on the academic transcript.
*   **Degree Award:** The resume does not mention that the degree will be awarded **\"with Distinction\"**. The transcript clearly states \"Bachelor of Science in Information Technology with Distinction (BSc)\". This is a significant achievement and should be added to the resume.
*   **Dean's List:** This is the most significant inconsistency.
    *   **Resume:** Lists \"Dean's List (2025)\".
    *   **Transcript:** Lists \"2022 DEAN'S LIST\" under the \"General Comments\" section.
    *   **Verdict:** The year on the resume is incorrect. The Dean's List was awarded for a past academic year (likely 2021, given the high grades that year), with the award being noted in 2022. Listing it for 2025 is inaccurate.
*   **Graduation Date:**
    *   **Resume:** States the degree period is \"Feb 2019 – Nov 2024\".
    *   **Transcript:** Shows the degree will be \"Conferred on 12 February 2025\".
    *   **Verdict:** This is a minor and acceptable difference. \"Nov 2024\" represents the end of the final semester of study, while \"Feb 2025\" is the official administrative conferral date.

### **Projects**

The projects listed on the resume align correctly with the coursework on the transcript.

*   **Vehicle Licence Plate Detection System:** The resume correctly identifies this project was part of \"Image Processing and Pattern Recognition - UTS 41256\". The transcript confirms enrollment in subject `31256 Image Processing and Pattern Recognition` in the `2024 Spring Session` (which corresponds to \"Late 2024\").
*   **EWB Electricity Metres:** The resume correctly identifies this project was part of \"Software Development Studio\". The transcript confirms enrollment in subject `41113 Software Development Studio` in the `2024 Spring Session` (\"Late 2024\").

### **Summary of Inconsistencies**

| Item | Resume | Transcript | Status & Recommendation |
| :--- | :--- | :--- | :--- |
| **Dean's List** | Dean's List (2025) | 2022 DEAN'S LIST | **Inconsistent.** This is a factual error. The resume should be corrected to \"Dean's List (2022)\". |
| **Degree Award** | Bachelor of Science in Information Technology | Bachelor of Science in Information Technology with Distinction | **Omission.** The resume is missing a key achievement. It should be updated to \"Bachelor of Science in Information Technology with Distinction\". |
| **Graduation Date** | End Date: Nov 2024 | Conferral Date: 12 Feb 2025 | **Acceptable.** This is a standard way of representing graduation dates and is not a concern. |"""),
            ],
        ),
        types.Content(
            role="user",
            parts=[
                types.Part.from_text(text="""INSERT_INPUT_HERE"""),
            ],
        ),
    ]
    generate_content_config = types.GenerateContentConfig(
        thinking_config = types.ThinkingConfig(
            thinking_budget=-1,
        ),
        response_mime_type="text/plain",
    )

    for chunk in client.models.generate_content_stream(
        model=model,
        contents=contents,
        config=generate_content_config,
    ):
        print(chunk.text, end="")

if __name__ == "__main__":
    generate()
